import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import './Breed.css'

const Breed = () => {

    type BreedParams = {
        breed: string
    }

    const params = useParams<keyof BreedParams>() as BreedParams

    const [image, setImage] = useState<string>()
    const [breed, setBreed] = useState<string>()
    const [subBreed, setSubBreed] = useState<string>()


    useEffect(() => {
        setBreed(params.breed.split("-")[0])
        setSubBreed(params.breed.split("-")[1])
        axios.get(`https://dog.ceo/api/breed/{breed}/{subBreed}/images/random`)
        .then(res =>{
            setImage(res.data.message)
            console.log(breed)
        })
        .catch(err => {
            console.log(err)
        })
    }, [])

    return (
        <div>
            <h1>
                {subBreed}
            </h1>
            <img src={image}></img>
        </div>
    );
}

export default Breed;
